import React from 'react';

import Img1 from '../images/quick1.jpg';
import Img2 from '../images/quick2.jpg';
import Img3 from '../images/quick3.jpg';
import Img4 from '../images/quick4.jpg';
const Homes2 = () => {
  return (
    <>
      <div class="container">
        <div class="row">
          <div class="col-3">
            <img src={Img1} alt="1" />
          </div>
          <div class="col-3">
            {' '}
            <img src={Img2} alt="2" />
          </div>

          <div class="col-3">
            {' '}
            <img src={Img3} alt="3" />
          </div>

          <div class="col-3">
            {' '}
            <img src={Img4} alt="4" />
          </div>
        </div>
      </div>
    </>
  );
};

export default Homes2;
